import React from 'react'
import Jumbotron from 'react-bootstrap'
import "./entry.css"
const Entry = ()=>{
    return(
        <div className='entry-page bg-info'>
            <Jumbotron>Entry Page</Jumbotron>
        </div>
    )
}

export default Entry
